def find_1(pixels)
  coords_1 = []
  (0...pixels.size).each do |j|
    (0...pixels[1].size).each do |i|
      coords_1 << [i, j] if pixels[j][i] == 1
    end
  end
  coords_1
end

class Image
  attr_reader :pixels

  def initialize(pixels)
    @pixels = pixels
  end

  def output_image
    @pixels.each do |row|
      puts row.join
    end
  end

  def blur(n = 1)
    coords_1 = find_1(@pixels)
    blur_output = []
    i = 0
    puts @pixels.size.inspect
    while i < @pixels.size
      blur_output << Array.new(@pixels[1].size, 0)
      i += 1
    end
    blur_output.each_with_index do |row, y2|
      row.each_with_index do |col, x2|
        coords_1.each_with_index do |coord_1|
          blur_output[y2][x2] = 1 if (x2 - coord_1[0]).abs + (y2 - coord_1[1]).abs <= n
        end
      end
    end
    Image.new(blur_output)
  end
end

